import React from 'react';

function Blog() {
	return (
		<div>
			<div className="container mx-auto flex  flex-col justify-between items-center">

				<div>1</div>
				<div>2</div>
				<div>3</div>

			</div>
		</div>

	);
}

export default Blog;
